import Circle from "./Circle"

function App() {
  return (
    <div>
      <Circle bgColor="teal" />
      <Circle bgColor="tomato" />
    </div>
  );
}

interface PlayerShape {
  name: string;
  age: number;
}

const sayHello = (playerObj: PlayerShape) => `Hello ${playerObj.name}, you are ${playerObj.age} years old.`

sayHello({name: "nico", age: 20});


export default App;
